import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './CreatePayment.css';

function CreatePayment() {
    const [customerID, setCustomerID] = useState(''); // This will store the ObjectID from localStorage
    const [amount, setAmount] = useState('');
    const [currency, setCurrency] = useState('ZAR'); // Default currency
    const [recipientAccountNumber, setRecipientAccountNumber] = useState('');
    const [SWIFTCode, setSWIFTCode] = useState('NEDSZAJJXXX'); // Default SWIFT Code
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');
    const navigate = useNavigate();

    // Fetch customer data (ObjectID and account number) from localStorage on component mount
    useEffect(() => {
        const storedCustomerID = localStorage.getItem('customerID'); // The ObjectID stored in localStorage
        const storedAccountNumber = localStorage.getItem('accountNumber');

        // Set the customerID (ObjectID) and recipientAccountNumber (account number)
        if (storedCustomerID) {
            setCustomerID(storedCustomerID); // Auto-fill the ObjectID for the logged-in user
        }
        if (storedAccountNumber) {
            setRecipientAccountNumber(storedAccountNumber); // Auto-fill account number
        }
    }, []); // Empty dependency array means this runs only once when the component mounts

    const handleSubmit = async (e) => {
        e.preventDefault(); // Prevent page reload

        // Validate inputs
        if (!customerID || !amount || !currency || !recipientAccountNumber || !SWIFTCode) {
            setError('Please fill out all fields.');
            return;
        }

        // Get the token from localStorage
        const token = localStorage.getItem('token');

        try {
            const response = await axios.post('http://localhost:5000/api/payment/create', {
                customerID, // Send ObjectID
                amount: parseFloat(amount), // Convert to number
                currency,
                recipientAccountNumber,
                SWIFTCode
            }, {
                headers: {
                    Authorization: `Bearer ${token}` // Set the Authorization header
                }
            });

            // Check for successful response
            if (response.status === 201) {
                setSuccess('Payment created successfully!');
                setError('');

                // Redirect to the payments page with the created payment
                navigate('/payment', { state: { newPayment: response.data.payment } });
            } else {
                setError('Payment creation failed.');
            }
        } catch (err) {
            console.error("Error details:", err.response ? err.response.data : err);
            setError(err.response?.data?.message || 'Error creating payment');
            setSuccess('');
        }
    };

    return (
        <div>
            <h1>Create New Payment</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Customer ID (ObjectID):</label> {/* Display ObjectID here */}
                    <input 
                        type="text" 
                        value={customerID} // The ObjectID from localStorage
                        onChange={(e) => setCustomerID(e.target.value)} 
                        required 
                        readOnly // Make it read-only to prevent user modification
                    />
                </div>
                <div>
                    <label>Amount:</label>
                    <input 
                        type="number" 
                        value={amount} 
                        onChange={(e) => setAmount(e.target.value)} 
                        required 
                    />
                </div>
                <div>
                    <label>Currency:</label>
                    <input 
                        type="text" 
                        value={currency} 
                        onChange={(e) => setCurrency(e.target.value)} 
                        required 
                    />
                </div>
                <div>
                    <label>Recipient Account Number:</label>
                    <input 
                        type="text" 
                        value={recipientAccountNumber} 
                        onChange={(e) => setRecipientAccountNumber(e.target.value)} 
                        required 
                    />
                </div>
                <div>
                    <label>SWIFT Code:</label>
                    <input 
                        type="text" 
                        value={SWIFTCode} 
                        onChange={(e) => setSWIFTCode(e.target.value)} 
                        required 
                    />
                </div>
                <button type="submit">Create Payment</button>
            </form>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            {success && <p style={{ color: 'green' }}>{success}</p>}
        </div>
    );
}

export default CreatePayment;
